import React from 'react';

const QuickEditToolkit = ({ element, position, onEdit, onDuplicate, onDelete, onMoveUp, onMoveDown, onClose }) => {
    return (
        <div
            style={{
                position: 'absolute',
                left: position.x,
                top: position.y,
                background: '#fff',
                border: '1px solid #ccc',
                borderRadius: '4px',
                boxShadow: '0 2px 8px rgba(0,0,0,0.15)',
                display: 'flex',
                gap: '8px',
                padding: '4px',
            }}
        >
            <button onClick={onEdit}>Edit</button>
            <button onClick={onDuplicate}>Duplicate</button>
            <button onClick={onDelete}>Delete</button>
            <button onClick={onMoveUp}>Move Up</button>
            <button onClick={onMoveDown}>Move Down</button>
            <button onClick={onClose}>Close</button>
        </div>
    );
};

export default QuickEditToolkit;
